exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog");return parseCatalog(`https://www.shushenwu.com/${bid}/index.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="chapters"[^>]*>/,"</ul>"),recordRegex:/href="(?<url>[^"]+)">(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}})};